import React from 'react';
import SVG from "./blogging.svg";
const Home =() => {
	return ( 
		<>

<div class="jumbotron jumbotron-fluid text-white bg-transparent">
  <div class="container col-10">
  <svg>
  <img src={ sSVG } height="400px" className="float-right" /></svg>
    <h1 class="display-4">Fluid jumbotron</h1>
    <p class="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
    <button type="button" class="btn btn-outline-light rounded-pill">Get started</button>
     
  </div>
 
</div>
		
		
			
		</>
		);
};

export default Home;
